import React from 'react';
import '../styles/Style.css';

function Input(props) {
  const value = (e) => {
    props.value = e.props.value;
  };
  return (
    <div>
      <div>
        <h2>{props.symbol}</h2>
      </div>
      <fieldset>
        <input
          className={props.className}
          name={props.name}
          type="text"
          placeholder={props.placeholder}
          value={<value />}
        />
      </fieldset>
    </div>
  );
}

export default Input;
